import React from "react";

import styles from "./Login.module.scss";

export const Login = ()=> {
    return (
        <>
            <div className={styles.auth}>
                <div className={styles.choice}>
                    <h4>Авторизация</h4>
                    <h4>Регистрация</h4>
                </div>

                <hr />

                <form action=""></form>
            </div>
        </>
    )
}
